function getColor(data){

	return data < 0.0 ? '#FFEDA0' :
                data < 5 ? '#FED976':
		data < 10 ? '#FD8D3C':
		data < 15 ? '#E31A1C':
		data < 25 ? '#800026':
                   
		 	'#FFEDA0';
}





